
const { jsPDF } = window.jspdf;

let siteLogo = null;

// load your logo for the pdf
fetch("https://max1382.com/images/logos/max1382-logo.webp")
  .then(r => r.blob())
  .then(b => {
    const reader = new FileReader();
    reader.onload = () => siteLogo = reader.result;
    reader.readAsDataURL(b);
  });

const questions = [
  "I've been feeling optimistic about the future",
  "I've been feeling useful",
  "I've been feeling relaxed",
  "I've been feeling interested in other people",
  "I've had energy to spare",
  "I've been dealing with problems well",
  "I've been thinking clearly",
  "I've been feeling good about myself",
  "I've been feeling close to other people",
  "I've been feeling confident",
  "I've been able to make up my own mind about things",
  "I've been feeling loved",
  "I've been interested in new things",
  "I've been feeling cheerful"
];

const answers = {
  1: "None of the time",
  2: "Rarely",
  3: "Some of the time",
  4: "Often",
  5: "All of the time"
};

// build table on page load
window.onload = () => {
  const tbody = document.getElementById("questionList");
  questions.forEach((q, i) => {
    const row = document.createElement("tr");
    row.id = "row-" + i;
    row.innerHTML = `
      <td>${q}</td>
      ${[1,2,3,4,5].map(v => `
        <td class="text-center">
          <input type="radio" name="q${i}" value="${v}">
        </td>
      `).join("")}
    `;
    tbody.appendChild(row);
  });
};

function calculateReflection() {
  const form = document.getElementById("wellbeingForm");
  let allAnswered = true;
  let total = 0;
  let userAnswers = [];

  document.querySelectorAll("#questionList tr").forEach(r => r.classList.remove("table-danger"));

  for (let i = 0; i < questions.length; i++) {
    const radios = form.querySelectorAll(`input[name='q${i}']`);
    const selected = Array.from(radios).find(r => r.checked);

    if (!selected) {
      document.getElementById("row-" + i).classList.add("table-danger");
      allAnswered = false;
    } else {
      total += parseInt(selected.value);
      userAnswers.push({ question: questions[i], value: parseInt(selected.value) });
    }
  }

  if (!allAnswered) {
    alert("Please select one answer for every question before viewing your reflection.");
    const firstMissing = document.querySelector(".table-danger");
    if (firstMissing) firstMissing.scrollIntoView({ behavior: "smooth", block: "center" });
    return;
  }

  const max = questions.length * 5;
  const percent = Math.round((total / max) * 100);

  let advice = "";
  if (percent >= 80)
    advice = "Your responses suggest good overall wellbeing. Keep maintaining positive routines and social connections.";
  else if (percent >= 60)
    advice = "Your wellbeing appears mostly positive. Some areas may benefit from extra support or reflection.";
  else
    advice = "Your reflection suggests lower wellbeing. Consider speaking with a GP, counsellor, or wellbeing advisor.";

  document.getElementById("result").classList.remove("d-none");
  document.getElementById("scoreText").innerText =
    `Your reflection shows ${total} out of ${max} possible points (${percent}).`;
  document.getElementById("adviceText").innerText = advice;

  window.total = total;
  window.percent = percent;
  window.adviceText = advice;
  window.userAnswers = userAnswers;
}

function downloadPDF() {
  const doc = new jsPDF({ unit: "pt", format: "a4" });
  const margin = 50;
  let y = margin;


const logo = "data:image/png;base64,";
doc.addImage(logo, "PNG", 400, y + 50, 120, 40);


  // Title bar
  doc.setFillColor(0, 123, 131); // teal/green
  doc.rect(0, 0, 595, 70, "F");

  doc.setFont("helvetica", "bold");
  doc.setFontSize(22);
  doc.setTextColor(255, 255, 255);
doc.text("Wellbeing Reflection (WEMWBS)", 297.5, 40, { align: "center" });

  y = 90;

  // Section line
  doc.setDrawColor(200, 200, 200);
  doc.line(margin, y, 545, y);
  y += 25;

  // Date
  doc.setFont("helvetica", "normal");
  doc.setFontSize(11);
  doc.setTextColor(60, 60, 60);
  doc.text(`Completed: ${new Date().toLocaleString()}`, margin, y);
  y += 30;

  // Overview heading
  doc.setFont("helvetica", "bold");
  doc.setFontSize(14);
  doc.setTextColor(30, 30, 30);
  doc.text("Overview", margin, y);
  y += 20;

  // Summary points
  doc.setFont("helvetica", "normal");
  doc.setFontSize(12);
  doc.setTextColor(50, 50, 50);
  doc.text(`Total points: ${window.total} / ${questions.length * 5} (${window.percent})`, margin, y);
  y += 20;

  // Advice text
  const wrappedAdvice = doc.splitTextToSize(window.adviceText, 500);
  doc.text(wrappedAdvice, margin, y);
  y += wrappedAdvice.length * 14 + 20;

  // Divider
  doc.setDrawColor(200, 200, 200);
  doc.line(margin, y, 545, y);
  y += 30;

  // Detailed responses header
  doc.setFont("helvetica", "bold");
  doc.setFontSize(14);
  doc.setTextColor(30, 30, 30);
  doc.text("Detailed Responses", margin, y);
  y += 25;

  // Responses
  doc.setFont("helvetica", "normal");
  doc.setFontSize(11);
  doc.setTextColor(50, 50, 50);

  window.userAnswers.forEach((item, i) => {
    const q = `${i + 1}. ${item.question}`;
    const a = `Answer: ${answers[item.value]} (${item.value})`;

    const wrappedQ = doc.splitTextToSize(q, 470);
    doc.text(wrappedQ, margin, y);
    y += wrappedQ.length * 12 + 4;

    doc.setTextColor(80, 80, 80);
    doc.text(a, margin + 15, y);
    y += 20;
    doc.setTextColor(50, 50, 50);

    // Page break
    if (y > 760) {
      doc.addPage();
      y = margin;
    }
  });

  // Footer
  y += 20;
  doc.setFontSize(10);
  doc.setTextColor(120, 120, 120);
  doc.text("This reflection uses the WarwickEdinburgh Mental Wellbeing Scale (WEMWBS). Not a diagnostic tool.", margin, y);

  doc.save("Wellbeing-Reflection.pdf");
}